(window.webpackJsonp=window.webpackJsonp||[]).push([[182],{1075:function(e){e.exports={content:'<h2>reselect\u6e90\u7801\u4eae\u70b9\u4ecb\u7ecd</h2>\n<p><a href="https://github.com/stonehank/sourcecode-analysis/blob/master/source-code.reselect/README.md">\u5b8c\u6574\u6e90\u7801\u8bf4\u660e\u6ce8\u91ca</a></p>\n<p>\u5bfc\u56fe\uff1a</p>\n<p><img src="https://stonehank.github.io/articles/img/reselect.png" alt=""></p>\n<h3>defaultMemoize</h3>\n<p>\u4e00\u4e2a\u7f13\u5b58\u51fd\u6570\uff0c\u5176\u5185\u90e8\uff1a</p>\n<ol>\n<li>\u901a\u8fc7\u95ed\u5305\u4fdd\u5b58\u53c2\u6570\u548c\u7ed3\u679c</li>\n<li>\u6bcf\u6b21\u8c03\u7528\u5bf9\u53c2\u6570\u8fdb\u884c\u6d45\u6bd4\u8f83</li>\n<li>\u53c2\u6570\u6bd4\u8f83\u7ed3\u679c\u76f8\u540c\uff0c\u8fd4\u56de\u7f13\u5b58\u7684\u7ed3\u679c</li>\n</ol>\n<hr>\n<h3>createSelectorCreator, createSelector</h3>\n<p>reselect\u6700\u4e3b\u8981\u51fd\u6570</p>\n<ol>\n<li>\n<p><code>createSelectorCreator</code>\u8fd4\u56de\u4e00\u4e2a\u51fd\u6570\uff0c\u79f0\u4e3a<code>createSelector</code></p>\n</li>\n<li>\n<p><code>createSelector</code>\u63a5\u53d72\u7c7b\u53c2\u6570</p>\n<p><code>\u4f9d\u8d56\u6570\u636e\u51fd\u6570</code>(\u53ef\u4ee5\u6709\u591a\u4e2a)</p>\n<p><code>\u6570\u636e\u5904\u7406\u51fd\u6570</code>(\u5fc5\u987b\u653e\u5728\u53c2\u6570\u7684\u6700\u540e)\uff1a</p>\n</li>\n<li>\n<p><code>createSelector</code>\u7684\u5185\u90e8\u64cd\u4f5c</p>\n<ol>\n<li>\n<p>\u5bf9<code>\u4f9d\u8d56\u6570\u636e\u51fd\u6570</code>\u548c<code>\u6570\u636e\u5904\u7406\u51fd\u6570</code>\u6267\u884c\u7f13\u5b58\u51fd\u6570</p>\n</li>\n<li>\n<p>\u6bcf\u6b21\u6267\u884c<code>createSelector</code>\u7684\u65f6\u5019\uff0c\u4f9d\u6b21\u6bd4\u8f83<code>\u4f9d\u8d56\u6570\u636e\u51fd\u6570</code>\u548c<code>\u6570\u636e\u5904\u7406\u51fd\u6570</code>\u7684\u7f13\u5b58</p>\n<p>\u8fd9\u6837\u5904\u7406\u5c31\u53ef\u4ee5\u77e5\u9053\u8981\u60f3\u8fd4\u56de\u7f13\u5b58\u7684\u7ed3\u679c\uff0c\u5fc5\u987b\u8981\u8fbe\u5230\u4ee5\u4e0b\u6761\u4ef6\u4efb\u4e00\uff1a</p>\n<ol>\n<li><code>\u4f9d\u8d56\u6570\u636e\u51fd\u6570</code>\u7684\u53c2\u6570(\u4e00\u822c\u4e3a<code>store</code>)\u5168\u7b49\u6bd4\u8f83\u4e3atrue</li>\n<li><code>\u4f9d\u8d56\u6570\u636e\u51fd\u6570</code>\u7684\u53c2\u6570(\u4e00\u822c\u4e3a<code>store</code>)\u5168\u7b49\u6bd4\u8f83\u4e3afalse, <code>\u6570\u636e\u5904\u7406\u51fd\u6570</code>\u7684\u53c2\u6570\u5168\u7b49\u6bd4\u8f83\u4e3atrue</li>\n</ol>\n</li>\n</ol>\n</li>\n<li>\n<p>\u8fd4\u56de<code>\u4f9d\u8d56\u6570\u636e\u51fd\u6570</code></p>\n<p><a href="https://codesandbox.io/s/jlpozpjprw">reselect\u4f7f\u7528\u4f8b\u5b50</a></p>\n</li>\n</ol>\n<hr>\n<h3>createStructuredSelector</h3>\n<p>\u4e00\u4e2a\u4fbf\u5229\u7684\u51fd\u6570\uff0c\u53ef\u4ee5\u7528\u4e8e\u53d8\u66f4\u6570\u636e\u7684key\u503c\uff0c\u901a\u8fc7\u5d4c\u5957\u53ef\u4ee5\u53d8\u66f4\u6570\u636e\u7684\u7ed3\u6784</p>\n<p>\u5b83\u7684\u5185\u90e8\u6b63\u662f\u8c03\u7528\u4e86<code>createSelector</code></p>\n<ol>\n<li>\n<p>\u63a5\u53d72\u4e2a\u51fd\u6570\uff0c\u5206\u522b\u4e3a\u4e00\u4e2a(\u53c2\u65701)\u5bf9\u8c61\uff0c\u4e00\u4e2a(\u53c2\u65702)<code>selectorCreator</code>(\u9ed8\u8ba4\u5c31\u662fcreateSelector)</p>\n</li>\n<li>\n<p>\u8c03\u7528<code>createSelector</code>\uff0c\u5c06\u53c2\u65701(\u5bf9\u8c61)\u7684value\u503c\u4f5c\u4e3a<code>\u4f9d\u8d56\u6570\u636e\u51fd\u6570</code>\uff0c\n\u5176<code>\u6570\u636e\u5904\u7406\u51fd\u6570</code>\u5c31\u662f\u4e00\u4e2a\u5c06\u53c2\u65701(\u5bf9\u8c61)\u7684key\u503c\u548c<code>\u4f9d\u8d56\u6570\u636e\u51fd\u6570</code>\u7684\u8fd4\u56de\u503c\u7ec4\u6210\u4e00\u4e2a\u65b0\u7684\u5bf9\u8c61\u7684\u8fc7\u7a0b\u3002</p>\n<p><a href="https://codesandbox.io/s/53kvl30564">createStructuredSelector\u4f7f\u7528\u4f8b\u5b50</a></p>\n</li>\n</ol>\n<hr>\n<p>\u6ce8\u610f\u70b9\uff1a</p>\n<ol>\n<li>\n<p>\u7f13\u5b58\u51fd\u6570\u53ea\u80fd\u4fdd\u5b58\u4e0a\u4e00\u6b21\u7f13\u5b58\u7684\u503c(\u5355\u4e2a)\u3002</p>\n</li>\n<li>\n<p>\u7f13\u5b58\u51fd\u6570\u662f\u901a\u8fc7\u5bf9\u6bd4\u53c2\u6570\u800c\u8fdb\u884c\u5224\u65ad\u7684\uff0c\u56e0\u6b64\u5fc5\u987b\u4fdd\u8bc1\u6240\u63d0\u4f9b\u7684<code>\u4f9d\u8d56\u6570\u636e\u51fd\u6570</code>\u548c<code>\u6570\u636e\u5904\u7406\u51fd\u6570</code>\u90fd\u662f\u7eaf\u51fd\u6570\uff0c\u800c\u4e14\u5b83\u53ea\u4fdd\u5b58\u4e0a\u4e00\u6b21\u51fd\u6570\u3002</p>\n<p><a href="https://codesandbox.io/s/n6y126v2p">\u975e\u7eaf\u51fd\u6570\u4f8b\u5b50</a></p>\n</li>\n<li>\n<p>\u8981\u60f3\u53d6\u6d88\u7f13\u5b58\uff0c\u5fc5\u987b\u53d6\u6d88\u5f15\u7528\uff0c\u5305\u62ec<code>\u4f9d\u8d56\u6570\u636e\u51fd\u6570</code>\u53c2\u6570(store)\u7684\u5f15\u7528\u548c\u5185\u90e8<code>\u6570\u636e\u5904\u7406\u51fd\u6570</code>\u7684\u53c2\u6570\u5f15\u7528</p>\n<p><a href="https://codesandbox.io/s/lx1kq3lj39">\u53d6\u6d88\u7f13\u5b58\u4f8b\u5b50</a></p>\n</li>\n</ol>\n'}}}]);
